declare module 'react' {
  import { CSSProperties, ChangeEvent, Component, MouseEvent, MutableRefObject, ReactElement, ReactNode, RefObject, WheelEvent } from 'react';
  export const CSSProperties: typeof CSSProperties;
  export const ChangeEvent: typeof ChangeEvent;
  export const Component: typeof Component;
  export const MouseEvent: typeof MouseEvent;
  export const MutableRefObject: typeof MutableRefObject;
  export const ReactElement: typeof ReactElement;
  export const ReactNode: typeof ReactNode;
  export const RefObject: typeof RefObject;
  export const WheelEvent: typeof WheelEvent;
  export function createElement(type: any, props?: any, children?: any): ReactElement;
  export function createRef<T>(): RefObject<T>;
  export function useEffect(callback: () => void, dependencies?: any[]): void;
  export function useMemo<T>(factory: () => T, dependencies?: any[]): T;
  export function useRef<T>(initialValue?: T): RefObject<T>;
  export function useState<S>(initialState: S): [S, (value: S) => void];
}

declare module 'react-dom/client' {
  import { createRoot } from 'react-dom/client';
  export function createRoot(container: HTMLElement | DocumentFragment, options?: any): Root;
}
